static inline float processSample(float x) noexcept {
    const float ax = std::fabs(x);
    const float s  = (x < 0.0f) ? -1.0f : 1.0f;

    if (ax <= kKneeStart) return x;
    if (ax >= kKneeEnd)   return s * kKneeLut.back();

    const float t = (ax - kKneeStart) * ((kLutSize - 1) / (kKneeEnd - kKneeStart));
    int i0 = (int) t;
    if (i0 < 0) i0 = 0;
    if (i0 > kLutSize - 2) i0 = kLutSize - 2;
    const float frac = t - (float) i0;

    const float y0 = kKneeLut[(size_t)i0];
    const float y1 = kKneeLut[(size_t)i0 + 1];
    const float y  = y0 + (y1 - y0) * frac;
    return s * y;
}
